import { FaLanguage, FaPizzaSlice, FaShoppingCart } from "react-icons/fa";
import {
  MdOutlineNotificationsNone,
  MdArrowDownward,
  MdLineStyle,
} from "react-icons/md";
import { FiSettings } from "react-icons/fi";

export {
  FaLanguage,
  MdOutlineNotificationsNone,
  FiSettings,
  FaPizzaSlice,
  FaShoppingCart,
  MdArrowDownward,
  MdLineStyle,
};
